import React, {Component} from 'react'
import PDPImage from '../../assets/PDP-logo.jpg'
import APCImage from '../../assets/APC.jpg'

class ViewResults extends Component{

render(){
	return(
		<div>
			<h2>2019 Nigeria General Elections</h2>
			<row><div className="col-md-6"><img src={APCImage} alt='APC' width='500' />
			<label>Total Votes:</label>
			<input type="text" name="APCtotal" className="well"/></div>
			<div className="col-md-6"><img src={PDPImage} alt='PDP' width='800'/>				
			<input type="text" name="PDPtotal" className="well"/></div></row>
			<br />
					</div>
		)
	}
}

export default ViewResults;
